import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import styled from "styled-components";

export default class Login extends Component {
    render() {
        return (
            <ProductWrapper>
            <div className="container">
            <div className="row">
                <div id="modal" className="col-8 mx-auto col-md-6 col-lg-4 text-center text-capitalize p-5" >
                    <div className="d-flex">
                        <h5>item added to the cart</h5>

                    </div>

                    <h5>hi</h5>
                    <h5 className="text-muted" > Price : GHc </h5>
                    <Link to="/">
                        <button className="cs" >
                           Store
                        </button>
                    </Link>
                    <Link to="/cart">
                        <button className="cs1" >
                          view Cart
                        </button>
                    </Link>
                </div>
            </div>
           </div>
           </ProductWrapper>
        )
    }
}

const ProductWrapper = styled.div`
background:rgba(0,0,0,0.3);
display: flex;
align-items: center;
justify-content: center;


#modal{
    background: white;
    border-radius:70px;

}
.cs{
    border-style: solid;
    border: 2px solid #2a2a72;
    border-radius:20px;
    padding:5px;
    color:#2a2a72;
    background: white;
}
.cs:hover{
    box-shadow: 0px 0px 10px black;
    font-size:20px;
}
.cs1:hover{
    box-shadow: 0px 0px 10px black;
    font-size:20px;

}
.cs1{
    border-style: solid;
    border: 2px solid #ffa400;
    border-radius:20px;
    padding:5px;
    color:#ffa400;
    background: white;
}
`
